  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0115010 includes discrete
  sample and profile data collected from HUDSON in the Davis Strait, Labrador Sea
  and North Atlantic Ocean from 1996-05-12 to 1996-06-01 and retrieved during cruise
  WOCE_AR07_1996 (AR01). These data include CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-113
  (CFC-113), CHLOROFLUOROCARBON-12 (CFC-12), Carbon tetrachloride (CCL4), DISSOLVED
  INORGANIC CARBON (DIC), DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE, Potential
  temperature (theta), SALINITY, TOTAL ALKALINITY (TA), WATER TEMPERATURE, phosphate
  and silicate. The instruments used to collect these data include CTD and bottle.nnThese
  data were collected by Peter E. Jones of Bedford Institute of Oceanography as part
  of the WOCE_AR07_1996 (AR01) data set.nnThe World Ocean Circulation Experiment (WOCE)
  was a major component of the World Climate Research Program with the overall goal
  of better understanding the ocean's role in climate and climatic changes resulting
  from both natural and anthropogenic causes. The CO2 survey took advantage of the
  sampling opportunities provided by the WOCE Hydrographic Program (WHP) cruises during
  this period between 1990 and 1998. The final collection covers approximately 23,000
  stations from 94 WOCE cruises.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
